import React from "react";
import { Link } from "react-router-dom";

function Dashboard() {
  return (
    <div style={{
      background: "linear-gradient(to bottom, #f0f5f9, #dfeef5)",
      height: "100vh",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      paddingTop: "60px"
    }}>
      <h1 style={{ color: "#2a4d69", marginBottom: "20px" }}>Library Books Reservation</h1>

      <div style={{
        background: "#fff",
        padding: "20px",
        borderRadius: "12px",
        boxShadow: "0 4px 15px rgba(0,0,0,0.1)",
        width: "300px",
        textAlign: "center"
      }}>
        <h2 style={{ color: "#2a4d69" }}> Welcome to the Online Book Reservation</h2>
        <div style={{ display: "flex", flexDirection: "column", gap: "12px", marginTop: "20px" }}>
          <Link to="/books"><button> List of Books</button></Link>
          <Link to="/profile"><button>My  Profile</button></Link>
          <Link to="/fees"><button> My Due Fees</button></Link>
          <Link to="/taken"><button> Books Taken</button></Link>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
